    def parse(self, response):
        for raptor in response.xpath('//section[@id="main"]'):
            yield {
               
                'breadcrumbs': raptor.xpath('//ul[@class="breadcrumbs"]//text()').extract(),
                'title': raptor.xpath('//span[@itemprop="description"]//text()').extract(),
                'brand': raptor.xpath('//span[@itemprop="brand"]//text()').extract(),
                'category': raptor.xpath('//span[@itemprop="category"]').extract(),
                'allval': raptor.xpath('//div[@class="container_top"]//h5//text()').extract(),
                'img_container': raptor.xpath('//div[@class="img_container"]').extract(),
                'price': raptor.xpath('//span[@itemprop="price"]//text()').extract(),
                'weight': raptor.xpath('//span[@itemprop="weight"]//text()').extract(),
                'Shipping from': raptor.xpath('//div[@style="font-size: 11px; padding-left: 40px; max-height: 300px; overflow-y: auto;"]//text()').extract(),
                'info-table': raptor.xpath('//table[@class="info-table"]//text()').extract(),
                'description-table': raptor.xpath('//table[@class="description-table"]//text()').extract(),
                'new-table': raptor.xpath('//div[@class="block"]').extract()
            }

